                        elseif j == 10
                            sysInfo.numMethod = "FullDis";
                            sysInfo.numNodes = 2;
                            sysInfo.initGuessApprox = 0; %0 = use feed mol fraction vector and small total flux value (use if Forward Euler IVP approx fails)
                            sysInfo.nodalGuessApprox = 1; %only applicable to FUD methods N>1
                            sysInfo.noGammaFugacityODEs = 1;
                        elseif j == 11
                            sysInfo.numMethod = "FullDis";
                            sysInfo.numNodes = 1;
                            sysInfo.initGuessApprox = 1; %0 = use feed mol fraction vector and small total flux value (use if Forward Euler IVP approx fails)
                            sysInfo.nodalGuessApprox = 1; %only applicable to FUD methods N>1
                            sysInfo.noGammaFugacityODEs = 1;
                        elseif j == 12
                            sysInfo.numMethod = "FullDis";
                            sysInfo.numNodes = 1;
                            sysInfo.initGuessApprox = 1; %0 = use feed mol fraction vector and small total flux value (use if Forward Euler IVP approx fails)
                            sysInfo.nodalGuessApprox = 1; %only applicable to FUD methods N>1
                            sysInfo.noGammaFugacityODEs = 0;
                        elseif j == 13
                            sysInfo.numMethod = "FullDis";
                            sysInfo.numNodes = 1;
                            sysInfo.initGuessApprox = 0; %0 = use feed mol fraction vector and small total flux value (use if Forward Euler IVP approx fails)
                            sysInfo.nodalGuessApprox = 1; %only applicable to FUD methods N>1
                            sysInfo.noGammaFugacityODEs = 1;
                        elseif j == 14
                            sysInfo.numMethod = "FullDis";
                            sysInfo.numNodes = 1;
                            sysInfo.initGuessApprox = 0; %0 = use feed mol fraction vector and small total flux value (use if Forward Euler IVP approx fails)
                            sysInfo.nodalGuessApprox = 1; %only applicable to FUD methods N>1
                            sysInfo.noGammaFugacityODEs = 0;
                        elseif j == 15
                            sysInfo.numMethod = "FullDis";
                            sysInfo.numNodes = 1;
                            sysInfo.initGuessApprox = 1; %0 = use feed mol fraction vector and small total flux value (use if Forward Euler IVP approx fails)
                            sysInfo.nodalGuessApprox = 1; %only applicable to FUD methods N>1
                            sysInfo.noGammaFugacityODEs = 0;
                            sysInfo.memPhaseModel_FicksOG = 1;
                        elseif j == 16
                            sysInfo.numMethod = "FullDis";
                            sysInfo.numNodes = 1;
                            sysInfo.initGuessApprox = 0; %0 = use feed mol fraction vector and small total flux value (use if Forward Euler IVP approx fails)
                            sysInfo.nodalGuessApprox = 1; %only applicable to FUD methods N>1
                            sysInfo.noGammaFugacityODEs = 0;
                            sysInfo.memPhaseModel_FicksOG = 1;
                        end
                        if j == 1
                            tic;
                            [localCompFlux_j,partialFlux_j,exitFlag] = asyMemLocalSolve(sysInfo);
                            timeElapsed = toc;
                            trueSolution = localCompFlux_j;
                            shootAlgTime_wGIG = timeElapsed;
                            sysInfo.numNodes = 96; %signifying SA was used
                        elseif j == 2
                            tic;
                            [localCompFlux_j,partialFlux_j,exitFlag] = asyMemLocalSolve(sysInfo);
                            timeElapsed = toc;
                            shootAlgTime_woGIG = timeElapsed;
                            sysInfo.numNodes = 96; %signifying SA was used
                        end
                        if contains(sysInfo.numMethod,'FullDis') && sysInfo.numNodes > 1 && sysInfo.initGuessApprox == 0 
                            while 1
                                tic;
                                try
                                    [localCompFlux_j,partialFlux_j,exitFlag,output] = asyMemLocalSolve(sysInfo);
                                catch
                                    localCompFlux_j = 86*ones(sysInfo.n+1,1);
                                    partialFlux_j = 86*ones(sysInfo.n,1);
                                    exitFlag = -42;
                                end
                                timeElapsed = toc;
                                if ~(sum(abs((localCompFlux_j-trueSolution)./trueSolution))/length(localCompFlux_j) > 0.001) || ~(sysInfo.numNodes < 30)%|| ~(2.5*shootAlgTime_woGIG>=timeElapsed) || ~(sysInfo.numNodes < 30)
                                    break;
                                else
                                    sysInfo.numNodes = sysInfo.numNodes + 1;
                                end
                            end
                        elseif contains(sysInfo.numMethod,'FullDis') && sysInfo.numNodes > 1 && sysInfo.initGuessApprox == 1
                            while 1
                                tic;
                                try
                                    [localCompFlux_j,partialFlux_j,exitFlag,output] = asyMemLocalSolve(sysInfo);
                                catch
                                    localCompFlux_j = 86*ones(sysInfo.n+1,1);
                                    partialFlux_j = 86*ones(sysInfo.n,1);
                                    exitFlag = -42;
                                end
                                timeElapsed = toc;
                                if ~(sum(abs((localCompFlux_j-trueSolution)./trueSolution))/length(localCompFlux_j) > 0.001) || ~(sysInfo.numNodes < 30)%|| ~(2.5*shootAlgTime_wGIG>=timeElapsed) || ~(sysInfo.numNodes < 30)
                                    break;
                                else
                                    sysInfo.numNodes = sysInfo.numNodes + 1;
                                end
                            end
                        else
                            tic;
                            try
                                [localCompFlux_j,partialFlux_j,exitFlag,output] = asyMemLocalSolve(sysInfo);
                            catch
                                localCompFlux_j = 86*ones(sysInfo.n+1,1);
                                partialFlux_j = 86*ones(sysInfo.n,1);
                                exitFlag = -42;
                            end
                            timeElapsed = toc;
                        end
                        if exitFlag ~= 1 && exitFlag ~= 2 && exitFlag ~= 3 && exitFlag ~= 4
                            failedRuns = [failedRuns,[exitFlag;u;y;w;i;j]];
                        end
                        allNumMeth = [allNumMeth,[exitFlag;timeElapsed;sum(abs((localCompFlux_j-trueSolution)./trueSolution))...
                            /length(localCompFlux_j);sysInfo.numNodes;output.iterations;localCompFlux_j]];
                    end
                    allMix = [allMix;allNumMeth];
                end
                allSim = [allSim;allMix];
            end
            allSolAlg = [allSolAlg;allSim];
        end
        allRandInitGuess = [allRandInitGuess;allSolAlg];
        randInitGuessLog = [randInitGuessLog,genCustomInitGuessApprox];
    end
    

